import React from "react";
import { ChakraProvider, Image } from "@chakra-ui/react";
import { Pagination, Navigation, Keyboard, Autoplay } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./carousel.css";

// images
import SafetyJacket from "../Image/temp-img/SafetyJacket.png";
import Foot from "../Image/temp-img/FootSole.png";

const Herocarousel = () => {
  return (
    <>
      <ChakraProvider>
        <Swiper
          style={{
            "--swiper-navigation-color": "red",
            "--swiper-pagination-color": "pink",
            // "--"
          }}
          slidesPerView={1}
          spaceBetween={30}
          loop={true}
          pagination={{
            clickable: true,
          }}
          autoplay={{
            delay: 2500,
            disableOnInteraction: false,
          }}
          keyboard={{
            enabled: true,
          }}
          navigation={true}
          modules={[Pagination, Navigation, Keyboard, Autoplay]}
          className="mySwiper"
        >
          <SwiperSlide>
            <Image src={SafetyJacket} />
          </SwiperSlide>
          <SwiperSlide>Slide 2</SwiperSlide>
          <SwiperSlide>Slide 3</SwiperSlide>
          <SwiperSlide>Slide 4</SwiperSlide>
        </Swiper>
      </ChakraProvider>
    </>
  );
};

export default Herocarousel;
